import React from "react";
import styled from 'styled-components';

const StyledDiv=styled.div`
  border-top: 1px solid grey;
  margin: 3vh;
`;



const Contents=() =>{
    return(
        <StyledDiv>
            <img src ="../img/main1.jpg" />
            <h1></h1>

        </StyledDiv>
    );
}

export default Contents;
